import React from 'react';
import s from './GanttLightBox.module.css'

const GanttLightBox = ({onClose}) => {

    const handleSubmit = (event) => {
        event.preventDefault();
        onClose();
    };

    return (
        <div className={s.container} onSubmit={handleSubmit}>
            <div className={s.title}>
                <input type="text"/>
                <span>Базовая задача: <a href="#">Название задачи родителя</a></span>
            </div>
            <button type="submit">Submit</button>
            <button type="button" onClick={onClose}>
                Close
            </button>
        </div>
    );
};

export default GanttLightBox;
